//cdn.jsdelivr.net/gh/wu529778790/image/blog/%E5%BE%AE%E4%BF%A1%E5%9B%BE%E7%89%87_20210318112842.png" alt="微信图片_20210318112842"></p>\n',lastUpdated:"2021/11/23, 22:44:00"},{title:"数据类型",frontmatter:{title:"数据类型",date:"2018-06-15T16:46:20.000Z",permalink:"/pages/15beed3c2f8d4/",categories:["面试题","JavaScript"],tags:[null]},regularPath:"/10.%E9%9D%A2%E8%AF%95%E9%A2%98/30.JavaScript/10.%E6%95%B0%E6%8D%AE%E7%B1%BB%E5%9E%8B.html",relativePath:"10.面试题/30.JavaScript/10.数据类型.md",key:"v-409f6df4",path:"/pages/15beed3c2f8d4/",headers:[{level:2,title:"js 原始数据类型？引用数据类型？",slug:"js-原始数据类型-引用数据类型"},{level:3,title:"原始值",slug:"原始值"},{level:3,title:"引用数据类型",slug:"引用数据类型"},{level:2,title:"null 是对象么",slug:"null-是对象么"},{level:2,title:"0.1+0.2 为什么不等于 0.3",slug:"_0-1-0-2-为什么不等于-0-3"},{level:2,title:"typeof",slug:"typeof"},{level:2,title:"instanceof 能否判断基本数据类型",slug:"instanceof-能否判断基本数据类型"},{level:2,title:"实现 instanceof 功能",slug:"实现-instanceof-功能"},{level:2,title:"Object.is 和 ===",slug:"object-is-和"},{level:2,title:"[] !== []",slug:""},{level:2,title:"js 类型转换哪几种？",slug:"js-类型转换哪几种"},{level:2,title:"== 和 ===",slug:"和"},{level:2,title:"对象转原始类型流程",slug:"对象转原始类型流程"},{level:2,title:"如何让 if( a === 1 && a === 2)成立",slug:"如何让-if-a-1-a-2-成立"},{level:2,title:"iframe 特殊处理",slug:"iframe-特殊处理"},{level:2,title:"参考链接",slug:"参考链接"}],excerpt:'\x3c!--beforebegin--\x3e<div class="language-js extra-class">\x3c!--afterbegin--\x3e<pre v-pre class="language-js"><code><span class="token class-name">Object</span><span class="token punctuation">.</span>prototype<span class="token punctuation">.</span><span class="token function">toString</span>\n  <span class="token punctuation">.</span><span class="token function">call</span><span class="token punctuation">(</span><span class="token punctuation">)</span>\n  <span class="token punctuation">.</span><span class="token function">match</span><span class="token punctuation">(</span><span class="token regex"><span class="token regex-delimiter">/</span><span class="token regex-source language-regex">\\[object (.*?)\\]</span><span class="token regex-delimiter">/</span></span><span class="token punctuation">)</span><span class="token punctuation">[</span><span class="token number">1</span><span class="token punctuation">]</span>\n  <span class="token punctuation">.</span><span class="token function">toLowerCase</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n\x3c!--beforeend--\x3e</div>\x3c!--afterend--\x3e<h2 id="js-原始数据类型-引用数据类型"><a class="header-anchor" href="#js-原始数据类型-引用数据类型">#</a> js 原始数据类型？引用数据类型？</h2>\n<h3 id="原始值"><a class="header-anchor" href="#原始值">#</a> 原始值</h3>\n<ul>\n<li>undefined</li>\n<li>null</li>\n<li>string</li>\n<li>number</li>\n<li>boolean</li>\n<li>symbol</li>\n<li>bigInt</li>\n</ul>\n<h3 id="引用数据类型"><a class="header-anchor" href="#引用数据类型">#</a> 引用数据类型</h3>\n<p>对象 Object</p>\n<ul>\n<li>普通对象 Object</li>\n<li>正则对象 RegExp</li>\n<li>函数对象 function</li>\n<li>数组对象 Array</li>\n<li>日起对象 Date</li>\n<li>数学函数 Math</li>\n</ul>\n',lastUpdated:"2021/09/13, 17:29:55"},{title:"隐式类型转换",frontmatter:{title:"隐式类型转换",date:"2021-11-12T12:13:09.000Z",permalink:"/pages/52123c6f578c7/",categories:["面试题","JavaScript"],tags:[null]},regularPath:"/10.%E9%9D%A2%E8%AF%95%E9%A2%98/30.JavaScript/11.%E9%9A%90%E5%BC%8F%E7%B1%BB%E5%9E%8B%E8%BD%AC%E6%8D%A2.html",relativePath:"10.面试题/30.JavaScript/11.隐式类型转换.md",key:"v-609fe98c",path:"/pages/52123c6f578c7/",lastUpdated:"2021/11/12, 22:24:53"},{title:"闭包",frontmatter:{title:"闭包",date:"2018-06-15T17:51:47.000Z",permalink:"/pages/84526eb582265/",categories:["面试题","JavaScript"],tags:[null]},regularPath:"/10.%E9%9D%A2%E8%AF%95%E9%A2%98/30.JavaScript/12.%E9%97%AD%E5%8C%85.html",relativePath:"10.面试题/30.JavaScript/12.闭包.md",key:"v-0aa53168",path:"/pages/84526eb582265/",headers:[{level:2,title:"什么是闭包",slug:"什么是闭包"},{level:2,title:"闭包产生的原因",slug:"闭包产生的原因"},{level:2,title:"闭包表现形式",slug:"闭包表现形式"},{level:2,title:"如何解决下面的循环输出问题",slug:"如何解决下面的循环输出问题"},{level:2,title:"参考链接",slug:"参考链接"}],excerpt:'<h2 id="什么是闭包"><a class="header-anchor" href="#什么是闭包">#</a> 什么是闭包</h2>\n<blockquote>\n<p>红宝书(p178)上对于闭包的定义：闭包是指有权访问另外一个函数作用域中的变量的函数</p>\n</blockquote>\n<blockquote>\n<p>MDN 对闭包的定义为：闭包是指那些能够访问自由变量的函数。（其中自由变量，指在函数中使用的，但既不是函数参数 arguments 也不是函数的局部变量的变量，其实就是另外一个函数作用域中的变量。）</p>\n</blockquote>\n',lastUpdated:"2021/11/12, 22:24:53"},{title:"原型和原型链",frontmatter:{title:"原型和原型链",date:"2018-06-10T15:28:35.000Z",permalink:"/pages/680e335c611f2/",categories:["面试题","JavaScript"],tags:[null]},regularPath:"/10.%E9%9D%A2%E8%AF%95%E9%A2%98/30.JavaScript/13.%E5%8E%9F%E5%9E%8B%E5%92%8C%E5%8E%9F%E5%9E%8B%E9%93%BE.html",relativePath:"10.面试题/30.JavaScript/13.原型和原型链.md",key:"v-3d9d9d04",path:"/pages/680e335c611f2/",headers:[{level:2,title:"原型对象和构造函数关系",slug:"原型对象和构造函数关系"},{level:2,title:"原型链",slug:"原型链"},{level:2,title:"链表",slug:"链表"},{level:2,title:"参考链接",slug:"参考链接"}],excerpt:'<h2 id="原型对象和构造函数关系"><a class="header-anchor" href="#原型对象和构造函数关系">#</a> 原型对象和构造函数关系</h2>\n<p>在 js 中，每当定义一个函数类型的时候，都会天生自带一个 prototype 属性，这个属性指向函数的原型对象</p>\n<p>在函数经过 new 调用时，这个函数就成了构造函数，返回一个全新的实例对象，这个实例对象有一个<strong>prototype</strong>属性，指向构造函数的原型对象</p>\n<p><img src="https://cdn.jsdelivr.net/gh/wu529778790/image/blog/20210610153911.png" alt="20210610153911"></p>\n',lastUpdated:"2021/09/13, 17:29:55"},{title:"继承",frontmatter:{title:"继承",date:"2018-06-15T19:16:34.000Z",permalink:"/pages/b58b52fcbc575/",categories:["面试题","JavaScript"],tags:[null]},regularPath:"/10.%E9%9D%A2%E8%AF%95%E9%A2%98/30.JavaScript/15.%E7%BB%A7%E6%89%BF.html",relativePath:"10.面试题/30.JavaScript/15.继承.md",key:"v-64223aab",path:"/pages/b58b52fcbc575/",headers:[{level:2,title:"js 如何实现继承",slug:"js-如何实现继承"},{level:3,title:"借助 call",slug:"借助-call"},{level:3,title:"借助原型链",slug:"借助原型链"},{level:3,title:"前两种结合",slug:"前两种结合"},{level:3,title:"组合继承的优化 1",slug:"组合继承的优化-1"},{level:3,title:"组合继承的优化 2（推荐）",slug:"组合继承的优化-2-推荐"},{level:3,title:"ES6 的 extends 被编译后的 JavaScript 代码",slug:"es6-的-extend